var textStyle = function (f) {
    var style = new ol.style.Style({
        image: new ol.style.Circle({
            radius: 5,
            stroke: new ol.style.Stroke({
                color: [255, 204, 51, 1],
                width: 3
            }),
            fill: new ol.style.Fill({
                color: [204, 153, 51, 0.8]
            })
        }),
        text: new ol.style.Text({
            font: '14px 微软雅黑',
            fill: new ol.style.Fill({
                color: '#000'
            }),
            stroke: new ol.style.Stroke({
                color: '#fff',
                width: 3
            }),
            textAlign: 'left',
            offsetX: 8,
            text: f.get('text')
        })
    });
    return [style];
};

